CREATE TABLE IF NOT EXISTS sera.sales_txn (
    reference TEXT PRIMARY KEY,
    transaction_date TEXT NOT NULL,
    user_id TEXT,
    amount NUMERIC,
    gateway_response TEXT,
    transaction_id BIGINT UNIQUE NOT NULL,
    card_type TEXT,
    card_bank TEXT,
    country_code TEXT,
    currency TEXT,
    subaccount NUMERIC,
    source TEXT,
    status TEXT,
    channel TEXT);

